import React from "react";
import { Card, Button } from "react-bootstrap";
function FeaturesCard(props) {
  return (
    <>
      <div>
        <h3>Demo</h3>
        <div className="m-5">
          <Card style={{ width: "15rem" }}>
            <Card.Img
              variant="top"
              src={props.Img}
              style={{ width: "00px", height: "100px" }}
            />
            <Card.Body>
              <Card.Title>{props.Title}</Card.Title>
              <Card.Text>
                {/* <li>Alstroemeria</li>
              <li>Calla Lily</li>
              <li>Daisy</li>
              <li>Gardenia</li>
            <li>Carnation</li> */}
                <li>{props.Text}</li>
              </Card.Text>
              <Button variant="primary" href="/">
                More Details
              </Button>
            </Card.Body>
          </Card>
        </div>
      </div>
    </>
  );
}

export default FeaturesCard;
